import React from "react";
import "./App.css";
import { Routes, Route } from "react-router-dom";
import Error from './Router/Error'
import Layout from "./component/Layout";

const App = () => {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Layout/>}>
          <Route path="*" element={<Error/>}/>
        </Route>
      </Routes>
    </div>
  );
};

export default App;
